import React from 'react';
import Link from 'next/link';
import Slider from '../components/Slider/Slider.component';

class App extends React.Component {

  render() {
    return (
      <div className='main-container'>
        <Link href='/itemgallery'>
          <button>Items</button>
        </Link>
        <Slider />
      </div>
    )
  }
}

export default App;
